import { computed, PropType, defineComponent } from 'vue';
import renderFn from '../utils/render-fn';
import {
  TdIconSVGProps, SVGJson,
} from '../utils/types';
import useSizeProps from '../utils/use-size-props';

import '../style/css';

const element: SVGJson = {"tag":"svg","attrs":{"fill":"none","viewBox":"0 0 16 16","width":"1em","height":"1em"},"children":[{"tag":"path","attrs":{"fill":"currentColor","d":"M4.73 7.26l.15-.7A3.2 3.2 0 018 4a3.2 3.2 0 013.12 2.56l.15.7.71.08A2.32 2.32 0 0114 9.67 2.3 2.3 0 0111.73 12H4.27A2.3 2.3 0 012 9.67c0-1.22.9-2.2 2.02-2.33l.71-.08zm7.37-.9A4.2 4.2 0 008 3a4.2 4.2 0 00-4.1 3.35A3.32 3.32 0 001 9.67 3.3 3.3 0 004.27 13h7.46A3.3 3.3 0 0015 9.67a3.32 3.32 0 00-2.9-3.32z","fillOpacity":0.9}}]};

export default defineComponent({
  name: 'CloudIcon',
  props: {
    size: {
      type: String,
    },
    onClick: {
      type: Function as PropType<TdIconSVGProps['onClick']>,
    },
  },
  setup(props, { attrs }) {
    const propsSize = computed(() => props.size);

    const { className, style } = useSizeProps(propsSize);

    const finalCls = computed(() => ['t-icon', 't-icon-cloud', className.value]);
    const finalStyle = computed(() => ({ ...style.value, ...(attrs.style as Styles) }));
    const finalProps = computed(() => ({
      class: finalCls.value,
      style: finalStyle.value,
      onClick: (e:MouseEvent) => props.onClick?.({ e }),
    }));
    return () => renderFn(element, finalProps.value);
  },

});
